[X-Art] Dina [Capture Me][SD](MAY 15,2015)

As Dina enters the room wearing stilettos and lingerie, it's obvious she only has one thing in mind. Jake on the other hand, wants to first capture her gorgeous body and doll-like face, so he starts snapping pictures of her. She smiles and flirts while persistently crawling across the bed toward him. The real fun begins when Dina pulls her panties aside for Jake to get a closer look, and finally he ditches the camera (as anyone would!) and captures her the way she's been wanting. Come and get it! xoxo Colette

